import React from "react";

import "../styles/dashboard.css";

export default class Dashboard extends React.Component {

    render() {
        return(
            <div className="screen" id="dashboard">
                <div className="title-large">Dashboard</div>

                <div className="dashboard-panel">
                    <div className="info-panel">
                        <div className="title-small">Welcome back, Tomáš</div>
                        <div className="text-small">
                            You have five new assignments this week and three messages.
                        </div>
                    </div>

                    <img className="image" src={require("../assets/profile.png")} />
                </div>
            </div>
        )
    }
}
